import React,{useState} from 'react'

export const Nav = () => {

  const [toggle, setToggle]=useState(false);

  const handleToggle=()=>{
    setToggle(!toggle);
  }

  return (
    <nav className={toggle?'navbar expanded':'navbar'}>
        <h2 className='logo'>NavBar</h2>
        <div className='' onClick={handleToggle}>
        <span></span><span></span>
        <span></span>
        </div>
        <ul className='links'>
          <li>Home</li>
          <li>About</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
    </nav>
  )
}
export default Nav
